pragma solidity ^0.8.10;


contract Registro {

    address[] private addressPeticiones;
    string[] private textoPeticiones;
  
    uint256 private peticionAProcesar = 0;
    uint256 private totalPeticiones = 0;

    address adminAddress = 0x50d3b84a2b1787b7704DD50c67733b6b5B293629;

    event MiEvento(string quien, uint256 valor);

    function registrarPeticion(string calldata mensajePeticion) payable public {
        addressPeticiones.push(msg.sender);
        textoPeticiones.push(mensajePeticion);
        totalPeticiones = totalPeticiones+1;
    }

    function verPeticionActual() view public returns (string memory){
        string memory textoPeticionActual = textoPeticiones[peticionAProcesar];
        return textoPeticionActual;
    }

    function contestarPeticionActual(uint256 respuesta) payable public {
        require(msg.sender == adminAddress, "No eres admin ");
        require(peticionAProcesar < totalPeticiones, "No hay peticiones ");

        // 0 >= 1
        if (respuesta == 1){
            textoPeticiones[peticionAProcesar] = 
            string(abi.encodePacked("[NO]",textoPeticiones[peticionAProcesar]));
            peticionAProcesar = peticionAProcesar+1;
        }
        if (respuesta == 2){
            textoPeticiones[peticionAProcesar] = 
            string(abi.encodePacked("[SI]",textoPeticiones[peticionAProcesar]));
            peticionAProcesar = peticionAProcesar+1;
        }
    }

    function getAllPeticiones() view public returns (string[] memory){
        return textoPeticiones;
    }

}
